	add("screamer", "{\"term\":\"screamer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who screams; one who shouts; one who sings harshly\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c.1840-41\u0027\u0027, w:Charles Charles Dickens, \u0027s:The Old Curiosity Shop/Chapter The Old Curiosity Shop\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Don\u0027t be frightened, mistress,\u0027 said Quilp, after a pause. \u0027Your son knows me; I don\u0027t eat babies; I don\u0027t like \u0027em. It will be as well to stop that young \u0027\u0027screamer\u0027\u0027 though, in case I should be tempted to do him a mischief. Holloa, sir! Will you be quiet\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1886\u0027\u0027, w:Henry Henry James, \u0027s:The The Bostonians\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He stood almost appalled for a moment, as he said to himself that she would take her up and the girl would be ruined, would force her note and become a \u0027\u0027screamer\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 June 27, \u0026quot;J2rider\u0026quot;, \u0026quot;Favourite companions to hate or love\u0026quot;, in \u0026lt;tt\u0026gt;rec.arts.drwho\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In my opinion, Sarah was a total \u0027\u0027screamer\u0027\u0027. [...] She screams in BRAIN OF MORIBUS, PYRAMIDS OF MARS, PLANET OF EVIL, REVENGE OF CYBERMEN, GENESIS OF DALEKS, SEEDS OF DOOM, ARK IN SPACE, etc, etc. In just about all her stories. When she is not screaming she is yelping, \u0026quot;Run Doctor RUNNNNNN!\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Any bird in the taxonomic family \u0027Anhimidae\u0027, endemic to South America, being large, bulky birds with a small downy head, long legs and large feet\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A healthy, vigorous animal.\u0026lt;ref name\u003ddofa\u0026gt;John Russell Bartlett, Dictionary of Americanisms — SCREAMER. A bouncing fellow or girl. This, like the word \u0027roarer\u0027, is one of the words transferred from animals to men by the hunters of the West.\u0026lt;/ref\u0026gt\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1917\u0027\u0027, w:Davy David Crockett, \u0027s:Southern Life in Southern Literature/David The Bear Hunt\u0027, in w:Maurice Garland Maurice Garland Fulton (editor), \u0027Southern Life in Southern Literature\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I had seen the track of the bear they were after, and I knowed he was a \u0027\u0027screamer\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A healthy, vigorous person.\u0026lt;ref name\u003ddofa /\u0026gt\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Something exceptionally good\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1875\u0027\u0027, w:Louisa May Louisa May Alcott, \u0027s:Eight Cousins/Chapter Eight Cousins\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"I do not judge hastily, Alec, for I have read a dozen, at least, of these stories, and, with much that is attractive to boys, I find a great deal to condemn in them, and other parents say the same when I ask them.\u0026quot\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"quot;Now, Mum, that\u0027s too bad! I like \u0027em tip-top. This one is a regular \u0027\u0027screamer\u0027\u0027,\u0026quot; cried Will\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A difficult catch\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 w:Adam Adam Gilchrist, \u0027True Colours\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"But then he came around the wicket again, I slashed at one, and Strauss, at full stretch diving to his left at second slip, took an absolute \u0027\u0027screamer\u0027\u0027. It was the catch of the summer, and it happened to me\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A very hard hit\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, R. G. Utley, Tim Peeler, Aaron Peeler, \u0027Outlaw Ballplayers: interviews and profiles from the Independent Carolina Baseball League\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027screamer\u0027\u0027 into the right field bleachers in the sixth with Scarborough and Viau on base put Hickory out in front 9 to 8 and the lead held for the rest of the game\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A particularly high mark (clean catch of a kicked ball\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, John Devaney, \u0027Full Points Footy\u0027s WA Football Companion\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Virtually every other facet of the game is shared by other sports, but the sight of a player taking a fingertip ‘\u0027\u0027screamer\u0027\u0027’ whilst perched on the shoulders of an opponent is unique to footy, and players who perfect this ability are among the code’s most celebrated and well remembered\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"a powerful shot\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"A very large wave\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Peter Klein, \u0027Silk Chaser\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"That set the pattern for us both. Catch a \u0027\u0027screamer\u0027\u0027, work it hard for as long as you could, then drop back over the shoulder and paddle back out to the line-up\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"A video that unexpectedly frightens the viewer by cutting to a loud scream and disturbing image\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Nadia Giosia, \u0027Bitchin\u0027 Kitchen Cookbook\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"The Web is also big business; who needs a real job when you can just send Grandma a \u0027\u0027screamer\u0027\u0027 and\u0026amp;mdash;POOF!\u0026amp;mdash;there\u0027s your inheritance\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"An effeminate gay man; a man who is obviously gay (homosexual\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Joseph P. Goodwin, \u0027More Man Than You’ll Ever Be: Gay Folklore and Acculturation in Middle America\u0027, Indiana University Press, ISBN 978-0-253-20497-4, [http://books.google.com/books?id\u003dhafi17WHyzAC\u0026amp;pg\u003dPA43\u0026amp;dq\u003dscreamer page 43\", \"priority\":34},{\"upperType\":\"NOUN\", \"text\":\"Well, this friend was a real effeminate person—[he] was just a \u0027\u0027\u0027screamer\u0027\u0027\u0027. \u0026lt;!-- [sic] italics --\u0026gt; Well even my brother was smart enough to realize they were gay\", \"priority\":35},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, in \u0027The Advocate\u0027, issues 607–610,\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003dIiEEAQAAIAAJ ]\u0026lt;/sup\u0026gt; page 315\", \"priority\":36},{\"upperType\":\"NOUN\", \"text\":\"So when w:George George Michael sings in his latest hit, “Girl, you\u0027re just too funky for me,” is he really singing about a woman? Or is he just being a total \u0027\u0027screamer\u0027\u0027 and gender-fucking his male love object\", \"priority\":37},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027 May 5, \u0026quot;cJ\u0026quot; (username), \u0026quot;Studly buff gay guy?\u0026quot;, in \u0026lt;tt\u0026gt;alt.tv.survivor\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":38},{\"upperType\":\"NOUN\", \"text\":\"I thought Jeff was a \u0027\u0027screamer\u0027\u0027. I am still wondering about Alicia. She hangs with Jeff. But I shouldn\u0027t assume someone is lesbian by the company they keep\", \"priority\":39}]}, \"synonyms\":{}}");

	add("screamo", "{\"term\":\"screamo\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|scream|emo|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A genre of aggressive lo-fi guitar driven music with predominantly screaming vocals, while preserving structural aspects of the emocore/hardcore emo genres of the early 1990\u0027s\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A genre of guitar driven music sometimes referred to as posthardcore, combining late 1990\u0027s emo indie rock with interludes of screaming vocals, often accompanied by hardcore or metalcore guitar riffs\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any punk rock inspired music that involves screaming vocals, typically referring to the genres described above as well as certain subgenres of hardcore punk\", \"priority\":3}]}, \"synonyms\":{}}");

	add("screech", "{\"term\":\"screech\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"1602; altered with expressive vowel lengthening from earlier {{m|en|skrech}} (1577), variant of obsolete {{m|en|scritch}}, from Middle english (1100-1500) {{m|enm|shrichen}}, {{m|enm|schrichen}} (1250), from Old english (ca. 450-1100) (attested as {{m|ang|scriccettan}}), from Proto-germanic {{m|gem-pro|*skrīkjanan}} (compare Icelandic \u0027skríkja\u0027 Old Saxon {{m|osx|scricōn}}), derivative of {{m|gem-pro|*skrīanan}} (compare German {{m|de|schreien}}, Low German dial. {{m|nds-de|schrien}}, {{m|nds-de|schriegen}}), ultimately of imitative origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A high-pitched strident or piercing sound, such as that between a moving object and any surface\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A harsh, shrill cry, as of one in acute pain or in fright; a shriek; a scream\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Newfoundland rum\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A form of home-made rye whiskey made from used oak rye barrels from a distillery\", \"priority\":4}]}, \"synonyms\":{}}");

	add("screed", "{\"term\":\"screed\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027screde\u0027 (lang\u003denm) (from which also \u0027shred\u0027 lt;ref name\u003d\u0026quot;tow\u0026quot;\u0026gt;“Spotlight on... Screed” \u0027[http://www.takeourword.com/ Take Our Word For It],\u0027 [http://www.takeourword.com/Issue001.html Issue 1], July 20, 1998\u0026lt;/ref\u0026gt;), from Old english (ca. 450-1100) \u0027scrēade\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A long discourse or harangue\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A piece of writing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A tool, usually a long strip of wood or other material, for producing a smooth, flat surface on, for example, a concrete floor or a plaster wall\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A smooth flat layer of concrete or similar material\", \"priority\":4}]}, \"synonyms\":{}}");

	add("screen", "{\"term\":\"screen\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Dutch\", \"old dutch\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) {{m|enm|scren}}, {{m|enm|screne||windscreen, firescreen}}, from Anglo-norman {{m|fro|escren||firescreen, the tester of a bed}}, Old french (842-ca. 1400) {{m|fro|escren}}, {{m|fro|escrein}}, {{m|fro|escran}} (modern French {{m|fr|écran||screen}}), from Old dutch {{m|odt|*scerm}}, {{m|odt|skirm||screen}}, from Proto-germanic {{m|gem-pro|*skirmiz||fur, shelter, screen}}, from Proto-indo-european {{m|ine-pro|*(s)ker-||to cut, divide}}. Cognate with Dutch {{m|nl|scherm||screen}}, German {{m|de|Schirm||screen}}.Alternate etymology derives Old French \u0027escren\u0027 from Old dutch {{m|odt|*skrank||barrier}} (compare German {{m|de|Schrank||cupboard}}, {{m|de|Schranke||fence}}.\u0026lt;ref\u0026gt;\u0027Webster\u0027s Encyclopedic Unabridged Dictionary of the English Language\u0027, s.v. \u0026quot;screen\u0026quot; (NY: Gramercy Books, 1996), 1721.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A physical divider intended to block an area from view, or provide shelter from something dangerous\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Your leavy \u0027\u0027screens\u0027\u0027 throw down\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Some ambitious men seem as \u0027\u0027screens\u0027\u0027 to princes in matters of danger and envy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A material woven from fine wires intended to block animals or large particles from passing while allowing gasses, liquids and finer particles to pass\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The informational viewing area of electronic output devices; the result of the output\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, Sex Pistols, \u0027Spunk\u0027, “Problems”\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"You won\u0027t find me living for the \u0027\u0027screen\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The viewing surface or area of a movie, or moving picture or slide presentation\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|passage\u003dThe stories did not seem to me to touch life. […] They left me with the impression of a well-delivered stereopticon lecture, with characters about as life-like as the shadows on the \u0027\u0027screen\u0027\u0027, and whisking on and off, at the mercy of the operator\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"One of the individual regions of a video game, etc. divided into separate screens\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Marcus Berkmann, \u0027Sophistry\u0027 (video game review) in \u0027Your Sinclair\u0027 issue 30, June 198\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The idea is to reach the 21st level of an enormous network of interlocking \u0027\u0027screens\u0027\u0027, each of which is covered with blocks that you bounce along on\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, \u0027Compute\u0027 (volume 11, page 51\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Bub and Bob, the brontosaur buddies, must battle bullies by bursting their bubbles. One or two players can move through 100 \u0027\u0027screens\u0027\u0027 of arcade-style graphics\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"An offensive tactic in which a player stands so as to block a defender from reaching a teammate\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The protective netting which protects the audience from flying object\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"An erection of white canvas or wood placed on the boundary opposite a batsman to make the ball more easily visible\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A frame supporting a mesh of bars or wires used to classify fragments of stone by size, allowing the passage of fragments whose a diameter is smaller than the distance between the bars or wires\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A stencil upon a framed mesh through which paint is forced onto printed-on material; the frame with the mesh itself\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A collection of less-valuable vessels that travel with a more valuable one for the latter\u0027s protection\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A dwarf wall or partition carried up to a certain height for separation and protection, as in a church, to separate the aisle from the choir, etc\", \"priority\":21}]}, \"synonyms\":{}}");

	add("screencast", "{\"term\":\"screencast\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined in 2004. {{blend|screen|broadcast|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A digital recording of a computer screen output\", \"priority\":1}]}, \"synonyms\":{}}");

	add("screener", "{\"term\":\"screener\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|screen|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, screens\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An advance screening of a film sent to critics, awards voters, etc\", \"priority\":2}]}, \"synonyms\":{}}");

	add("screenful", "{\"term\":\"screenful\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|screen|ful|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"As much as fits on a screen\", \"priority\":1}]}, \"synonyms\":{}}");

	add("screengrab", "{\"term\":\"screengrab\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|screen|grab|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A screenshot\", \"priority\":1}]}, \"synonyms\":{}}");

	add("screenland", "{\"term\":\"screenland\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The industry of films and filmmaking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, E. J. Fleming, \u0027Paul Bern\u0027 (page 53\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Paul\u0027s arrival in Hollywood coincided with an increase in public awareness that all wasn\u0027t perfect in \u0027\u0027screenland\u0027\u0027. In Hollywood, most early-1920s problems were drug-related\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Cyberspace, as accessed through a computer screen\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Maureen Patricia Carroll, \u0027Whitecaps on the Keyboard\u0027 (page 20\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"At times, different symbolic modes were intertwined. Labbo used the metaphor of \u0026quot;\u0027\u0027screenland\u0027\u0027\u0026quot; to describe the context of the children\u0027s actions with the computer. She identified three different stances: playing in screenland, art in screenland, and writing in screenland\", \"priority\":6}]}, \"synonyms\":{}}");

	add("screenlet", "{\"term\":\"screenlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|screen|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A visual widget or small application that can be placed on the desktop\", \"priority\":1}]}, \"synonyms\":{}}");

	add("screenplay", "{\"term\":\"screenplay\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"screen + play\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a script for a movie or a television sho\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1998,\u0027\u0027 \u0027Hairshirt\u0027 (aka \u0027Too Smooth\u0027, movie\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I know Corinne would be happy if I started writing scripts again. Since my last \u0027\u0027screenplay\u0027\u0027, I haven\u0027t written anything in over four months\", \"priority\":3}]}, \"synonyms\":{}}");

	add("screenspace", "{\"term\":\"screenspace\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|screen|space|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The space available on a screen display\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Mike Collins, \u0027Pro Tools LE and M-powered: the complete guide\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At this point you should tidy up your screen, resizing the windows and positioning them to make best use of your available \u0027\u0027screenspace\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jeremy Osborn, \u0027Dreamweaver CS4 Digital Classroom\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"If you have limited \u0027\u0027screenspace\u0027\u0027, double-click on the Insert panel to collapse it\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Marios C Angelides, \u0027Advances in Semantic Media Adaptation and Personalization\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"For example, designers can specify the minimum and maximum sizes a widget can have on a small \u0027\u0027screenspace\u0027\u0027 (eg, the screen of a mobile device\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Tom Gross, Jan Gulliksen, Paula Kotzé, \u0027Human-Computer Interaction - INTERACT 2009\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"They deal better with denser networks, offer ample \u0027\u0027screenspace\u0027\u0027 to display metrics for each edge and can more easily display change over time\", \"priority\":9}]}, \"synonyms\":{}}");

	add("screenwash", "{\"term\":\"screenwash\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|screen|wash|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The washing of the windscreen of a motor vehicle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A cleaning fluid used to wash the windscreen of a motor vehicle\", \"priority\":2}]}, \"synonyms\":{}}");

	add("screwback", "{\"term\":\"screwback\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The period of screw rotation during injection molding when the plastic can flow into the mold\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A hook-shapped attachment for an earring that sits behind the earlobe and tightens with a screw. Also, an earring that uses this type of attachment\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A mechanism for attaching a small item to clothing that operates by a post which goes through the cloth and a small backing plate that screws to the post. Also, the medal, tie pin, button, etc. that uses this type of attachment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A type of case for a pocket watch where the mechanism is accessed by a removable back plate that screws onto the back of the case. Also, a watch that has such a case\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The effect of putting backspin on the cue ball\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A powerful shot that imparts a spin to the ball\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A half-volley executed by holding the racket loosely and swinging it straight at the ball\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A masonry abutment on an arch that is wedge-shaped in order to transmit the thrust downward\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An industrial digging machine that uses a large screw at the back to drill into the ground\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A type of propeller in which the blades are angled to produce a motion similar to threading a screw. Also, the angle of the blades on such a propeller\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A tightening screw on the back of a hand tool\", \"priority\":11}]}, \"synonyms\":{}}");

	add("screwball", "{\"term\":\"screwball\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From screw + ball\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pitch thrown with added pressure by the index finger and a twisting wrist motion resulting in a motion to the right when thrown by a right-handed pitcher\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027screwball\u0027\u0027 is not thrown much because it tends to damage pitcher\u0027s arms\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who behaves in a crazy manner\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I will not listen to this \u0027\u0027screwball\u0027\u0027 any longer\", \"priority\":4}]}, \"synonyms\":{}}");

	add("screwdriver", "{\"term\":\"screwdriver\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|screw|driver|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hand or machine tool which engages with the head of a screw and allows torque to be applied to turn the screw, thus driving it in or loosening it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A drink made of vodka and orange juice\", \"priority\":2}]}, \"synonyms\":{}}");

	add("screwface", "{\"term\":\"screwface\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|screw|face|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A contorted facial expression made out of anger or frustration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Tracy M. Bush, \u0027A Blues for Mary\u0027, Lulu.com (2005), ISBN 9781599710976, [http://books.google.com/books?id\u003dhXFnAgAAQBAJ\u0026amp;pg\u003dPA134\u0026amp;dq\u003d%22screwface%22 page 134\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"“Oh, and tell your girl to stop giving me the \u0027\u0027screwface\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Alvin Glen Edwards, \u0027Once in an Island\u0027, AuthorHouse (2011), ISBN 9781456758103, [http://books.google.com/books?id\u003dZYem61MywssC\u0026amp;pg\u003dPA38\u0026amp;dq\u003d%22screwface%22 page 38\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She put on a \u0027\u0027screwface\u0027\u0027—an unfriendly facial contortion that denotes anger and frustration—then broke into the chant of a popular reggae protest song\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, George Vecsey, \u0027Eight World Cups: My Journey through the Beauty and Dark Side of Soccer\u0027, Times Books (2014), ISBN 9780805098495, [http://books.google.com/books?id\u003dGi6SAgAAQBAJ\u0026amp;pg\u003dPA249\u0026amp;dq\u003d%22screwface%22 page 249\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Klinsmann had to know from observing the cranky \u0027\u0027screwface\u0027\u0027 Dempsey displayed in public that this was no moonbeam of a player\", \"priority\":7}]}, \"synonyms\":{}}");

	add("scrim", "{\"term\":\"scrim\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Attested since the end of the 18th century. Origin {{unk.|en|title\u003dunknown}}. In one of the earliest mentions, \u0026quot;\u0027w:Statistical Accounts of Scotland|The Statistical Account of Scotland\u0027\u0026quot;, 1793, by John Sinclair, page 593, we read in a paragraph devoted to weavers: \u0026quot;Besides these, they are now much employed in working a thin kind of coarse linen called Silesias, vulgarly \u0027\u0027Scrims\u0027\u0027, whereof each piece is 27 or 30 inches broad ..\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kind of light cotton or linen fabric, often woven in openwork patterns, -- used for curtains, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A large military scarf, usually camouflage coloured and used for concealment when not used as a scarf\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A woven, nonwoven or knitted fabric composted of continuous strands of material used for reinforcing or strengthening membranes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A theater drop that appears opaque when a scene in front is lighted and transparent or translucent when a scene in back is lighted\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Thin canvas glued on the inside of panels to prevent shrinking, checking, etc\", \"priority\":5}]}, \"synonyms\":{}}");

	add("scribbler", "{\"term\":\"scribbler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|scribble|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who scribbles; a hasty or untalented writer or artist\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Granvill\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027scribbler\u0027\u0027, pinched with hunger, writes to dine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A machine for coarse carding or teasing of wool\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A ruled notebook or exercise book, especially in grade school\", \"priority\":5}]}, \"synonyms\":{}}");

	add("scribe", "{\"term\":\"scribe\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|scribe}}, from Old french (842-ca. 1400) {{m|fro|scribe||scribe}}, from usage of \u0027scriba\u0027 (secretary) (used in Vulgate to render Ancient Greek \u0027γραμματεύς\u0027 (scribe, secretary) which had been used in its turn to render the Hebrew \u0027סופר\u0027 (writer, scholar) from \u0027scribere\u0027 (to write, draw, draw up, draft (a paper), enlist, enroll, levy; \u0027orig\u0027. to scratch) probably akin to \u0027scrobs\u0027 (a ditch, trench, grave)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who writes; a draughtsman; a writer for another; especially, an official or public writer; an amanuensis or secretary; a notary; a copyist\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"date\u003d14 September page\u003dR28|passage\u003d[T]he pleasure of writing on wax with a stylus is exemplified by the fine, flowing hand of a Roman \u0027\u0027scribe\u0027\u0027 who made out the birth certificate of Herennia Gemella, born March 128 AD\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person who writes books or documents by hand as a profession\u0026lt;sup\u0026gt;\u0026lt;/sup\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/5/the-evolution-of-eyeglasses The Evolution of passage\u003dThe ability of a segment of a glass sphere to magnify whatever is placed before it was known around the year 1000, when the spherical segment was called a reading stone,. \u0027\u0027Scribes\u0027\u0027, illuminators, and scholars held such stones directly over manuscript pages as an aid in seeing what was being written, drawn, or read\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A writer and doctor of the law; one skilled in the law and traditions; one who read and explained the law to the people\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A very sharp, steel drawing implement used in engraving and etching, a scriber\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A writer, especially a journalist\", \"priority\":7}]}, \"synonyms\":{}}");

	add("scrilla", "{\"term\":\"scrilla\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Abiola Abrams, \u0027Dare\u0027, Pocket Books (2007), ISBN 9781416541660, [http://books.google.com/books?id\u003d-78dFzxZobEC\u0026amp;pg\u003dPA193 page 193\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;Who cares? I get to be the hot chick in the video. Do you know how much \u0027\u0027scrilla\u0027\u0027 video hos are raking in these days\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, w:Azealia Azealia Banks, \u0026quot;w:Liquorice Liquorice\u0026quot;, \u0027w:1991 1991\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"But I gotta dip, I gotta get at the cake / Lotta \u0027\u0027scrilla\u0027\u0027 to make\", \"priority\":4}]}, \"synonyms\":{}}");

	add("scrimmage", "{\"term\":\"scrimmage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A corruption of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rough fight\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, w:William Somerset W. Somerset Maugham, \u0027w:The Moon and The Moon and Sixpence\u0027, s:The Moon and Sixpence/Chapter chapter 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There was an instant of complete silence, but when Tough Bill threw himself on Strickland the lust of battle seized them all, and in a moment there was a confused \u0027\u0027scrimmage\u0027\u0027. Tables were overturned, glasses crashed to the ground\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In some team sports, especially soccer, a practice game which does not count on a team\u0027s record\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In American football or Canadian football, a play that begins with a snap from the center while opposing teams are on either side of a line of scrimmage\", \"priority\":5}]}, \"synonyms\":{}}");

	add("scrimp", "{\"term\":\"scrimp\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{etystub|en}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pinching miser; a niggard\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scrimshander", "{\"term\":\"scrimshander\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Origin unknown.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The manufacture of handcrafts by sailors on long voyages, especially as whittled from wood or bone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone who scrimshaws\", \"priority\":2}]}, \"synonyms\":{}}");

	add("scrimshaw", "{\"term\":\"scrimshaw\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Origin unknown.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The manufacture of handicrafts by sailors on long voyages, especially as whittled from wood or bone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An item produced by scrimshaw\", \"priority\":2}]}, \"synonyms\":{}}");

	add("scrippage", "{\"term\":\"scrippage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|scrip|age|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The contents of a scrip, or wallet\", \"priority\":1}]}, \"synonyms\":{}}");

	add("script", "{\"term\":\"script\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027scrit\u0027 from Old french (842-ca. 1400) \u0027escrit\u0027 from Latin \u0027scriptu. Latin|scriptum\u0027 (something written), from \u0027scrībō\u0027 (write)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A writing; a written document\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Written characters; style of writing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Type made in imitation of handwriting\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An original instrument or document\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The written document containing the dialogue and action for a drama; the text of a stage play, movie, or other performance. Especially, the final form used for the performance itself\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A file containing a list of user commands, allowing them to be invoked once to execute in sequence\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A system of writing adapted to a particular language or set of languages\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An abbreviation for a prescription\", \"priority\":8}]}, \"synonyms\":{}}");

	add("scripter", "{\"term\":\"scripter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|script|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A programmer who uses a scripting language\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scripting", "{\"term\":\"scripting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|script|ing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act by which something is scripted\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Javier A. Treviño, \u0027Goffman\u0027s Legacy\u0027 (page 130\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"After all, dramatic \u0027\u0027scriptings\u0027\u0027 of behavior are everywhere present in our media-drenched society, and these scriptings guide and organize real experience (Goffman 1974:55\", \"priority\":3}]}, \"synonyms\":{}}");

	add("scriptorium", "{\"term\":\"scriptorium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027scriptōrium\u0027 from Latin \u0027scriptōrius\u0027 (pertaining to writing)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A room set aside for the copying, writing, or illuminating of manuscripts and records, especially such a room in a monastery\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1907\u0027\u0027, G. Roger Huddleston, \u0026quot;Scriptorium\u0026quot; in \u0027The Catholic Encyclopedia\u0027, volume 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The rules of the \u0027\u0027scriptorium\u0027\u0027 varied in different monasteries, but artificial light was forbidden for fear of injury to the manuscripts, and silence was always enforced\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, James Ronald Royse, \u0027Scribal Habits in Early Greek New Testament Papyri\u0027, chapter 7, page 49\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Nevertheless, Aland criticized Martin\u0027s suggestion that the codex was the product of the \u0027\u0027scriptorium\u0027\u0027 attached to a monastery,\u0026lt;sup\u0026gt;536\u0026lt;/sup\u0026gt; on the grounds that there is no evidence for the existence of monasteries in the year 200, or for the existence of \u0027\u0027scriptoria\u0027\u0027 at all connected with the Church at that early date\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Fred S. Kleiner, \u0027Gardner\u0027s Art Through the Ages: The Western Perspective\u0027, 13th edition, volume 1, page 28\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Among the earliest Hiberno-Saxon illuminated manuscripts is the \u0027Book of Durrow\u0027, a Gospel book that may have been written and decorated in the monastic \u0027\u0027scriptorium\u0027\u0027 at Iona, although its provenance is not documented\", \"priority\":7}]}, \"synonyms\":{}}");

	add("scripturalist", "{\"term\":\"scripturalist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|scriptural|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who adheres literally to the Scriptures\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scripture", "{\"term\":\"scripture\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027scrīptūra\u0027 (a writing, scripture) from \u0027scrīptum\u0027 the supine of \u0027scrībō\u0027 (i write)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sacred writing or holy book\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The primary \u0027\u0027scripture\u0027\u0027 in Zoroastrianism is the Avesta\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Leander Keck, \u0027Who is Jesus?\u0027 (ISBN 0567088332), page 143\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It would be quite unwise to deem the whole historical enterprise as wrong-headed and to think that one can revert to the gospels\u0027 way of reading \u0027\u0027scripture\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An authoritative statement\", \"priority\":5}]}, \"synonyms\":{}}");

	add("scripturist", "{\"term\":\"scripturist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Scripture|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is strongly attached to, or versed in, the Scriptures, or who endeavours to live by them\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Palfre\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Puritan was a \u0027\u0027Scripturist\u0027\u0027 with all his heart, if as yet with imperfect intelligence he cherished the scheme of looking to the Word of God as his sole and universal directory\", \"priority\":3}]}, \"synonyms\":{}}");

	add("scriptwriter", "{\"term\":\"scriptwriter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|script|writer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who writes scripts\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scriptwriting", "{\"term\":\"scriptwriting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|script|writing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The writing of scripts, usually for film or television\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scrivener", "{\"term\":\"scrivener\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"Anglo-norman \u0027scrivein\u0027 (professional penman, copyist) from Old french (842-ca. 1400) \u0027escrivain\u0027 from Latin \u0027scriba\u0027 from \u0027scrībō\u0027 (i write)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A professional writer; one whose occupation is to draw contracts or prepare writings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1592\u0027\u0027, w:William William Shakespeare, w:Richard III Richard III, 3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Scrivener\u0027\u0027 (enters with a paper in hand\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Here is the indictment of the good Lord Hastings\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Which in a set hand fairly in engrosse\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"That is may be today read o\u0027er in Paul\u0027s\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"And mark how well the sequel hangs together\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Eleven hours I have spent to write it over\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"One whose business is to place money at interest; a broker\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A writing master. \u0026lt;!--i.e. teacher?--\u0026gt\", \"priority\":10}]}, \"synonyms\":{}}");

	add("scrod", "{\"term\":\"scrod\", \"etymology\":{\"influencers\":[], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\", \"Dutch\"], \"text\":\"Perhaps from an obsolete Dutch term \u0027schrood\u0027 (slice, shred) from Middle dutch (ca. 1050-1350) \u0027\u0027 (schrode, schroode) (in which case, it is ultimately cognate to \u0027shred\u0027 . Compare East Frisian\u0026lt;!--the Frisian language, not the German one! note that how to code this language is disputed; see RFM; User:-sche|-sche--\u0026gt; \u0027schrod\u0027 (small or worthless thing; shred)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any cod, pollock, haddock, or other whitefish\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scrofulousness", "{\"term\":\"scrofulousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"state of being morally degenerate or corrupt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scroggin", "{\"term\":\"scroggin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pre-prepared mixture of dried fruit and nuts to eat as a snack while bushwalking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Charles Rawlings-Way, Brett Atkinson, \u0027New Zealand\u0027, Lonely Planet, [http://books.google.com.au/books?id\u003dO9kxgh1WlZgC\u0026amp;pg\u003dPA76\u0026amp;lpg\u003dPA76\u0026amp;dq\u003d%22scroggin%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dCcj3CRxtp1\u0026amp;sig\u003dEwsJt1joXYkS679B1g1C9wUhEJY\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyP85UI3UA6SZiAeS3IHwDg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22scroggin%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 76\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And don′t forget your \u0027\u0027scroggin\u0027\u0027 – a mixture of dried fruit and nuts (and sometimes chocolate) for munching en route\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Warwick Sprawson, \u0027The Overland Track: Cradle Mountiain to Lake St Clair\u0027, Red Dog Books, Australia, [http://books.google.com.au/books?id\u003dCKu1_jComwwC\u0026amp;pg\u003dPA179\u0026amp;lpg\u003dPA179\u0026amp;dq\u003d%22scroggin%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dl032p2t4np\u0026amp;sig\u003djT7YwSoxPz3yEgkUq__PRXeQv58\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dyP85UI3UA6SZiAeS3IHwDg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22scroggin%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 179\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Trail mix\u0027\u0027 or ‘\u0027\u0027Scroggin\u0027\u0027’, is a mix of dried fruit, nuts and sometimes chocolate that′s popular with hikers\", \"priority\":7}]}, \"synonyms\":{}}");

	add("scroll", "{\"term\":\"scroll\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) \u0027*scrolle\u0027 \u0027scrowle\u0027 \u0027scrawle\u0027 from Old french (842-ca. 1400) \u0027escrouelle\u0027 \u0027escroele\u0027 (strip, roll) diminutive of \u0027escroue\u0027 \u0027escroe\u0027 (strip, scroll) More at {{l/en|escrow}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A roll of paper or parchment; a writing formed into a roll; a schedule; a list\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An ornament formed of undulations giving off spirals or sprays, usually suggestive of plant form. Roman architectural ornament is largely of some scroll pattern\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A mark or flourish added to a person\u0027s signature, intended to represent a seal, and in some States allowed as a substitute for a seal. [U.S.] Alexander Mansfield Burrill\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Scroll-shaped end of a violin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a skew surface\", \"priority\":5}]}, \"synonyms\":{}}");

	add("scrollback", "{\"term\":\"scrollback\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|scroll|back|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The part of a scrolling display that precedes the current line or section\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, \u0027InfoWorld\u0027 magazine (volume 15, number 15, April 1993\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The program can hold as many as 5000 lines of a session in a \u0027\u0027scrollback\u0027\u0027 buffer\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Charles Rubin, \u0027The Macintosh bible guide to ClarisWorks 4\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"New communications documents are set for a \u0027\u0027scrollback\u0027\u0027 area of unlimited size\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Dave Taylor, \u0027Learning UNIX for Mac OS X Tiger\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027scrollback\u0027\u0027 buffer allows you to scroll back and review earlier commands and command output\", \"priority\":7}]}, \"synonyms\":{}}");

	add("scroller", "{\"term\":\"scroller\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|scroll|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, scrol\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"scrolls\", \"priority\":2}]}, \"synonyms\":{}}");

	add("scrotum", "{\"term\":\"scrotum\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|la|scrōtum|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The bag of skin and muscle that contains the testicles in mammals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The female labia majora is homologous to the male \u0027\u0027scrotum\", \"priority\":2}]}, \"synonyms\":{}}");

	add("scrubfowl", "{\"term\":\"scrubfowl\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|scrub|fowl|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A megapode\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scrubland", "{\"term\":\"scrubland\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|scrub|land|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant community characterized by scrub vegetation, consisting of low shrubs, mixed with grasses, herbs, and geophytes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027scrubland\u0027\u0027 I\u0027d be crossing looked desolate, but at least it wasn\u0027t a desert\", \"priority\":2}]}, \"synonyms\":{}}");

	add("scrubwren", "{\"term\":\"scrubwren\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|scrub|wren|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various small, mainly insectivorous passerine birds of the family\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scrummage", "{\"term\":\"scrummage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ordered formation of forwards in which each side aims to gain control of the ball; a scrum\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A scrimmage\", \"priority\":2}]}, \"synonyms\":{}}");

	add("scrumpy", "{\"term\":\"scrumpy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|scrump|y|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rough cider, normally more alcoholic than usual, and typically produced through natural fermentation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scrunchie", "{\"term\":\"scrunchie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|scrunch|ie|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small elasticated ring of fabric placed around long hair to hold it in place behind the head\", \"priority\":1}]}, \"synonyms\":{}}");

	add("scruple", "{\"term\":\"scruple\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\", \"Sanskrit\"], \"text\":\"From Old french (842-ca. 1400) \u0027scrupule\u0027 from Latin \u0027scrūpulus\u0027 (uneasiness of mind, trouble, anxiety, doubt, scruple, literally a small sharp or pointed stone, the twenty-fourth part of an ounce) diminutive of \u0027scrūpus\u0027 (a rough or sharp stone, anxiety, uneasiness) perhaps akin to Ancient greek (to 1453) \u0027σκύρος|lang\u003dgrc\u0027 () \u0027ξυρόν\u0027 (a razor) Sanskrit \u0027क्षुर|tr\u003dkṣura\u0027 (a razor)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A weight of twenty grains; the third part of a dram\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Hence, a very small quantity; a particle\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Ca \u0027\u00271601–1608\u0027\u0027, w:William Shakespeare, \u0027As You Like It\u0027, Act II Scene 3 221–22\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Paroles: \u0027I have not, my lord, deserved it.\u0027 Lafeu: \u0027Yes, good faith, ev\u0027ry dram of it, and I will not bate thee a \u0027\u0027scruple\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Hesitation as to action from the difficulty of determining what is right or expedient; unwillingness, doubt, or hesitation proceeding from motives of conscience\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He was made miserable by the conflict between his tastes and his \u0027\u0027scruples\u0027\u0027.\u0027 - w:Thomas Babington Thomas Babington Macaulay\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A doubt or uncertainty concerning a matter of fact; intellectual perplexity\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A measurement of time. Hebrew culture broke the hour into 1080 scruples\", \"priority\":8}]}, \"synonyms\":{}}");

	add("scrutineer", "{\"term\":\"scrutineer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|scrutiny|eer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who scrutinises; a person responsible for\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"scrutineering\", \"priority\":2}]}, \"synonyms\":{}}");

	add("scrutiny", "{\"term\":\"scrutiny\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"Proto-Germanic\", \"old high german (ca. 750-1050)\", \"gothic\"], \"text\":\"From Middle english (1100-1500) \u0027scrutiny\u0027 from {{m|la|scrūtinium||a search, an inquiry}}, from {{m|la|scrūtārī||to search or examine thoroughly}}, of uncertain origin. Possibly from {{m|la|scrūta||rubbish, broken trash}}; or of Proto-germanic origin, related to Old english (ca. 450-1100) {{m|ang|scrūtnung||examination, investigation, inquiry, search}}, from Old english (ca. 450-1100) {{m|ang|scrūtnian}}, {{m|ang|scrūdnian||to examine carefully, scrutinize, consider, investigate}}, from Proto-germanic {{m|gem-pro|*skrudōną}}, {{m|gem-pro|*skruþōną||to search, examine}}, from Proto-germanic {{m|gem-pro|*skrud-}}, {{m|gem-pro|*skruþ-||to cut}}, from Proto-indo-european {{m|ine-pro|*(s)kreut-||to cut}}. Compare Old high german (ca. 750-1050) {{m|goh|skrodōn}}, {{m|goh|scrutōn}}, {{m|goh|scrutilōn||to research, explore}}, Old high german (ca. 750-1050) \u0027scrod\u0027 (a search, scrutiny) Gothic {{m|got|𐌰𐌽𐌳𐌷𐍂𐌿𐍃𐌺𐌰𐌽||to investigate, explore}}, Old english (ca. 450-1100) {{m|ang|scrēadian||to shred, cut up, cut off, peel, pare, prune}}. More at {{l|en|shred}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Intense study of someone or something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thenceforth I thought thee worth my nearer view / And narrower \u0027\u0027scrutiny\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Thorough inspection of a situation or a case\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An examination of catechumens, in the last week of Lent, who were to receive baptism on Easter Day\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A ticket, or little paper billet, on which a vote is written\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An examination by a committee of the votes given at an election, for the purpose of correcting the poll\", \"priority\":7}]}, \"synonyms\":{}}");

	add("scryer", "{\"term\":\"scryer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|scry|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who divines, sees or predicts the future by means of a scrying tool; especially a crystal ball\", \"priority\":1}]}, \"synonyms\":{}}");

